import React from "react";
import axios from "axios";
import Link from "next/link";

class Zipcodeinput extends React.Component {
  static async getInitialProps() {
    var promise = axios
      .get("http://localhost:4000/zipcodeinput")
      .then(response => {
        return {
          hasErrored: false,
          zipcodeinputData: response.data
        };
      })
      .catch(error => {
        return {
          hasErrored: true,
          message: error.message
        };
      });
    return promise;
  }

  constructor(props) {
    super(props);
    this.state = {
      hasErrored: props.hasErrored,
      message: props.message,
      zipcodeinputData: props.zipcodeinputData
    };
  }

  componentDidMount() {}

  componentWillUnmount() {}

  render() {
    return (
      <div className="container dwi-div dwi-card">
        <div>
          <h5>Challenge #2</h5>
        </div>
        <div className="row">

          <div className="card-deck">
            <div className="card col-10 cardmin margintopbottom dwi-form-section">

  

              <div className="dwi-radio-items">
              {this.state.zipcodeinputData.map((zipcodeinput) =>

                <div className="form-check"  key={zipcodeinput.zipCode}>
                {zipcodeinput.city} 

                {/* "stateAbbrevation":"NY",
      "city":"Schenectady", */}


                </div>
              )}
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Zipcodeinput;
